CREATE TABLE IF NOT EXISTS Meals (
    MealID INTEGER,
    MealName TEXT,
    ServedAt INTEGER,
    Description TEXT,
    Votes INTEGER,
    Allergen INTEGER,
    DietaryConstraints INTEGER,
    Macros INTEGER,
    PRIMARY KEY (MealID),
    FOREIGN KEY (ServedAt) REFERENCES DiningHall(HallID),
    FOREIGN KEY (Votes) REFERENCES Votes(VoteID),
    FOREIGN KEY (Allergen) REFERENCES Allergens(AllergenID),
    FOREIGN KEY (DietaryConstraints) REFERENCES DietaryRestrictions(ConstraintID),
    FOREIGN KEY (Macros) REFERENCES Macros(MacroID)
);
